\begin{lemma}\label{lem:2}
Let $f$ be a function defined on $\mathbb{R}^n$ and $f(x) = \sum_{i=1}^n f_i(x_i)$, where $f_i$ is a function of $x_i$ only. Then, $\nabla f(x) = \sum_{i=1}^n \frac{\partial f}{\partial x_i}(x_i)$.
\end{lemma}

\begin{proof}
Let $x = (x_1, x_2, \dots, x_n)$. Then, we have
\begin{align*}
\nabla f(x) &= \begin{pmatrix}
\frac{\partial f}{\partial x_1}(x_1) \\
\frac{\partial f}{\partial x_2}(x_2) \\
\vdots \\
\frac{\partial f}{\partial x_n}(x_n)
\end{pmatrix} \\
&= \begin{pmatrix}
\frac{\partial}{\partial x_1} \sum_{i=1}^n f_i(x_i) \\
\frac{\partial}{\partial x_2} \sum_{i=1}^n f_i(x_i) \\
\vdots \\
\frac{\partial}{\partial x_n} \sum_{i=1}^n f_i(x_i)
\end{pmatrix} \\
&= \begin{pmatrix}
\frac{\partial f_1}{\partial x_1}(x_1) & 0 & \cdots & 0 \\
0 & \frac{\partial f_2}{\partial x_2}(x_2) & \cdots & 0 \\
\vdots & \vdots & \ddots & \vdots \\
0 & 0 & \cdots & \frac{\partial f_n}{\partial x_n}(x_n)
\end{pmatrix} \\
&= \begin{pmatrix}
\frac{\partial f_1}{\partial x_1}(x_1) \\
\frac{\partial f_2}{\partial x_2}(x_2) \\
\vdots \\
\frac{\partial f_n}{\partial x_n}(x_n)
\end{pmatrix} \\
&= \nabla f_1(x_1) + \nabla f_2(x_2) + \cdots + \nabla f_n(x_n).
\end{align*}
\end{proof}

